use udw
go

	
DECLARE @Data TABLE(SSN VARCHAR(9))



SELECT
	RS10.*
FROM
	UDW..RS10_BR_RPD RS10
	INNER JOIN @Data D
		ON D.SSN = RS10.BF_SSN

SELECT
	LN65.*
FROM
	UDW..LN65_LON_RPS LN65
	INNER JOIN @Data D
		ON D.SSN = LN65.BF_SSN

SELECT
	LN66.*
FROM
	UDW..LN66_LON_RPS_SPF LN66
	INNER JOIN @Data D
		ON D.SSN = LN66.BF_SSN

SELECT
	RS05.*
FROM
	UDW..RS05_IBR_RPS RS05
	INNER JOIN @Data D
		ON D.SSN = RS05.BF_SSN